      if (!accessToken) {
        throw new Error("Access token not found");
      }

      const response = await fetch(
        "https://nf-api.onrender.com/api/v1/holidaze/bookings",
        {
          headers: {
            Authorization: `Bearer ${accessToken}`,
          },
        }
      );

      if (!response.ok) {
        throw new Error("Failed to fetch enquiries");
      }

